function Body() {
    return (
      <Container>
          <Row>
          <Col>
          <Figure>
              <Figure.Image
                width={1080}
                height={1080}
                alt=""
                src="homepage.jpg"
              />

        </Figure>
        </Col>
        <Col>
          <Figure.Caption>
            <h2 className = "h2_title">
              Welcome to JARVIS, you want to fix something, JARVIS can do it for
               you
            </h2>

              </Figure.Caption>
          </Col>
          </Row>
        </Container>

    )
  }


export default Body;
